import styled from "styled-components";

export const TableContainer = styled.div`
    display: flex;
    flex-direction: column;
    align-content: stretch;
    align-items: flex-start;

    .users-dates{
        display: flex;
        width: 100%;
    }
    .users-table{
        padding: 5rem;
    }
    .users-graphic{
        padding: 5rem;
        display: flex;
    }
`
